import React from 'react'

const Footer = () => {
    return (
        <div className="gpt3__footer">
            <div className="gpt3__footer-heading">
                <h1 className="gradient__text">
                    Do you want to step into the future before others.
                </h1>
            </div>
        </div>
    )
}

export default Footer
